import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import './App.css';

import Home from './Elements/Home'


function App() {
  return (
    <BrowserRouter basename='/'>
      <Routes>
        <Route path='/' element={ <Home/> } />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
